import { useEffect, useState } from "react"

const Data = () => {

    const [data , setData] = useState([])

    useEffect(()=>{
        getData()
    },[])

    async function getData(){
        
        const data = await fetch("http://localhost:3001/getUser",{
            method :"get",
            headers : {
                "Context-Text" : "application/json"
            }
        })

        const json = await data.json()

console.log(json);
        if(json.status){
            setData(json.data)
        }

    }
 
console.log(data);
    if(data.length === 0) return null


    return (
        <div>
            {
                data.map((user) => (
                    <div key={user._id}>
                    <div>Account Number -- {user.AccountNumber}</div>
                    <div>CustomerId -- {user.CustomerId}</div>
                    <div>MobileNumber -- {user.MobileNumber}</div> 
                    <div>DOB -- {user.DOB}</div> 
                    </div>
                ))
            }
        </div>
    )
}

export default Data
